import MyHeader from "../../components/header/MyHeader";
import styles from "./MainPage.module.css"
import face_care from "./../../assets/img/face_care.svg"
import body_care from "./../../assets/img/body_care.svg"
import big_logo from "./../../assets/img/big_logo.svg"
import arrow from "./../../assets/img/arrow.svg"
import MyBtn from "../../components/MyBtn/MyBtn";
import Banner from "../../components/Banner/Banner";


const MainPage = () => {
  return (
    <div className={styles.main_main_page}>
      <Banner/>
    </div>
  );
}

export default MainPage;
